rtedMap = new Map(Array.from(htDates.entries()).sort((a, b) => a[0] > b[0] ? 1 : -1)); // sort by keys\n    this.barChartLabels2 = Array.from(sortedMap.keys());        // update bar chart labels\n    this.barChartData2[0].data = Array.from(sortedMap.values());; //Array.from(htDates.values());  // update bar chart data\n\n\n  }\n\n\n\n}\n\n    \n\n    \n        \n    \n        \n            \n            \n        \n    \n\n\n    \n        \n            \n            \n        \n    \n\n\n    \n        \n            \n        \n    \n\n\n    \n\n    \n                \n                    ./flowarea.component.css\n                \n                button.calendar, button.calendar:active {\n  width: 2.20rem;\n  height: 2.20rem;\n  background-image: url('data:image/png;base64,') !important;\n  background-repeat: no-repeat;\n  background-size: 23px;\n  background-position: center;\n}\n/* \n::ng-deep .ag-cell-label-container .ag-header-cell-label {\n  color: rgb(122, 255, 128);\n  background-color: brown;\n  /* Force the width corresponding at how much width\n    we need once the text is laid out vertically *\n  height: 100% !important;\n  justify-content: center !important;\n} */\n\n\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '                                                                                                                                    '\n    var COMPONENTS = [{'name': 'AgGridDatePickerComponent', 'selector': 'date-editor-cell'},{'name': 'AlertsComponent', 'selector': ''},{'name': 'AppComponent', 'selector': 'body'},{'name': 'BadgesComponent', 'selector': ''},{'name': 'ButtonComponent', 'selector': 'app-button'},{'name': 'CardsComponent', 'selector': ''},{